import { Home } from './screens/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles/main.css';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
